import {  TextField, IconButton } from 'material-ui/core';

import { SearchOutlined } from 'material-icons';

<TextField
fullWidth
id="standard-bare"
variant="outlined"
defaultValue="How can we help"
InputProps={{
  endAdornment: (
    <IconButton>
      <SearchOutlined />
    </IconButton>
  ),
}}
/>
